  // const [findedChords, setFindedChords] = useState;
  const onSubmit = (e) => {
    e.preventDefault();
    console.log(e.target.key.value);
    console.log(e.target.suffix.value);
  };
  return (
    <>
      <form onSubmit={onSubmit} action="">
        <label htmlFor="">
          KEY
          <input type="text" name="key" />
        </label>

        <label htmlFor="">
          SUFFIX
          <input type="text" name="suffix" />
        </label>
        <button type="submit">O</button>
      </form>
      <div>
        <ul></ul>
      </div>
    </>
  );
};

